webpackJsonp([0xa14ef56a0a3f],{5744:function(e,t){e.exports={data:{post:{html:"<p>Translated from <a href=\"http://www.welt.de\">Die Welt</a>: Hamburg - The Schill Party received ca. 4.4 percent of the vote in Hamburg (nationwide: ca. 0.6 percent). Thus the party failed to achieve its goal of eight percent. Party Founder Ronald Schill does not, however, want to give up his national political ambitions. 'In principle this is a disappointing result,' he admitted, but that it is 'no embarassment to have landed under five percent'.</p>",fields:{title:"Schill Party: 0.6%",date:"23 Sep 2002",url:"https://papascott.de/2002-09-23-schill-party-06/"}}},pathContext:{slug:"/2002-09-23-schill-party-06/",prev:{fields:{title:"Day of Resignation",date:"23 Sep 2002",slug:"/2002-09-23-day-of-resignation/"}},next:{fields:{title:"How Did We Get Into This Mess?",date:"24 Sep 2002",slug:"/2002-09-24-how-did-we-get-into-this-mess/"}}}}}});
